(()=>{"use strict";window.addEventListener("load",(()=>{!function(){const e=document.querySelector("#hamburger"),s=document.querySelector(".header__links");e.addEventListener("click",(()=>{e.classList.contains("open")?(e.classList.remove("open"),s.classList.remove("mobile-nav--animate")):(e.classList.add("open"),s.classList.add("mobile-nav--animate"))}))}()}))})();